import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import styled, { ThemeProvider, createGlobalStyle } from "styled-components";

import { SuspenseFetch } from "./modules/SuspenseFetch";
import { SuspenseFetchError } from "./modules/SuspenseFetchError";
import { NormalFetch } from "./modules/NormalFetch";
import { NormalFetchError } from "./modules/NormalFetchError";
import { Nav } from "./shared/Nav";

import logo from "./instaCat.png";

import "./styles.css";

const theme = {
  skeleton: `
    background: #ebebeb;
    position: relative;
    overflow: hidden;

    &::after {
      display: block;
      content: "";
      position: absolute;
      width: 100%;
      height: 100%;
      transform: translateX(-100%);
      background: linear-gradient(
        90deg,
        transparent,
        rgba(255, 255, 255, 0.4),
        transparent
      );
      animation: loading 1.5s infinite;
    }

    @keyframes loading {
      100% {
        transform: translateX(100%);
      }
    }
  `,
  colors: {
    primary: "",
    secondary: "",
    tertiary: "#dbdbdb",
    cuaternary: "white"
  }
};

const rootElement = document.getElementById("root");

const GlobalStyles = createGlobalStyle`
  body {
    margin: 0px;
    padding: 0px;
    font-family: Arial;
  }
`;

const AppHeader = styled.header`
  position: absolute;
  top: 0;
  display: flex;
  justify-content: center;
  width: 100%;
  height: 56px;
  background: ${({ theme }) => theme.colors.cuaternary};
  border-bottom: 1px solid ${({ theme }) => theme.colors.tertiary};
  z-index: 2;
`;

const AppHeaderContainer = styled.div`
  max-width: 614px;
  width: 100%;
  display: flex;
  align-items: center;
`;

const AppTitle = styled.h1`
  height: 24px;
  margin: 0;
  padding: 0;

  & img {
    height: 100%;
    height: 100%;
    display: flex;
  }
`;

const HeaderSeparator = styled.div`
  margin: 0 16px;
  width: 1px;
  background: black;
  height: 28px;
`;

const AppMain = styled.main`
  margin-top: 56px;
  overflow: auto;
  height: calc(100% - 56px);
`;

const AppContainer = styled.div`
  display: flex;
`;

const Root = () => (
  <ThemeProvider theme={theme}>
    <GlobalStyles />
    <BrowserRouter>
      <AppContainer>
        <Nav />
        <div style={{ width: "100%", position: "relative", height: "100vh" }}>
          <AppHeader>
            <AppHeaderContainer>
              <svg
                aria-label="Instagram"
                fill="#262626"
                height="24"
                viewBox="0 0 48 48"
                width="24"
              >
                <path d="M13.86.13A17 17 0 008 1.26 11 11 0 003.8 4 12.22 12.22 0 001 8.28 18 18 0 00-.11 14.1c-.13 2.55-.13 3.38-.13 9.9s0 7.32.13 9.9A18 18 0 001 39.72 11.43 11.43 0 003.8 44 12.17 12.17 0 008 46.74a17.75 17.75 0 005.82 1.13c2.55.13 3.38.13 9.9.13s7.32 0 9.9-.13a17.82 17.82 0 005.83-1.13A11.4 11.4 0 0043.72 44a11.94 11.94 0 002.78-4.24 17.7 17.7 0 001.13-5.82c.13-2.55.13-3.38.13-9.9s0-7.32-.13-9.9a17 17 0 00-1.13-5.86A11.31 11.31 0 0043.72 4a12.13 12.13 0 00-4.23-2.78A17.82 17.82 0 0033.66.13C31.11 0 30.28 0 23.76 0s-7.31 0-9.9.13m.2 43.37a13.17 13.17 0 01-4.47-.83 7.25 7.25 0 01-2.74-1.79 7.25 7.25 0 01-1.79-2.74 13.23 13.23 0 01-.83-4.47c-.1-2.52-.13-3.28-.13-9.7s0-7.15.13-9.7a12.78 12.78 0 01.83-4.44 7.37 7.37 0 011.79-2.75A7.35 7.35 0 019.59 5.3a13.17 13.17 0 014.47-.83c2.52-.1 3.28-.13 9.7-.13s7.15 0 9.7.13a12.78 12.78 0 014.44.83 7.82 7.82 0 014.53 4.53 13.12 13.12 0 01.83 4.44c.13 2.51.13 3.27.13 9.7s0 7.15-.13 9.7a13.23 13.23 0 01-.83 4.47 7.9 7.9 0 01-4.53 4.53 13 13 0 01-4.44.83c-2.51.1-3.28.13-9.7.13s-7.15 0-9.7-.13m19.63-32.34a2.88 2.88 0 102.88-2.88 2.89 2.89 0 00-2.88 2.88M11.45 24a12.32 12.32 0 1012.31-12.35A12.33 12.33 0 0011.45 24m4.33 0a8 8 0 118 8 8 8 0 01-8-8" />
              </svg>
              <HeaderSeparator />
              <AppTitle>
                <img src={logo} alt="logo" />
              </AppTitle>
            </AppHeaderContainer>
          </AppHeader>
          <AppMain>
            <Switch>
              <Route path="/normal-fetch-data">
                <NormalFetch />
              </Route>
              <Route path="/normal-fetch-error">
                <NormalFetchError />
              </Route>
              <Route path="/suspense-fetch-data">
                <SuspenseFetch />
              </Route>
              <Route path="/suspense-fetch-error">
                <SuspenseFetchError />
              </Route>
            </Switch>
          </AppMain>
        </div>
      </AppContainer>
    </BrowserRouter>
  </ThemeProvider>
);

ReactDOM.render(<Root />, rootElement);
